    false,nt"url": null,nt"notes": "NCEI Accession 0117060 includes time series
    data collected from MOORINGS in the North Atlantic Ocean from 2010-12-05 to 2013-03-15
    and retrieved during cruise HogR20101205 and HogR20120229. These data include AIR-SEA
    DIFFERENCE - PARTIAL PRESSURE (OR FUGACITY) OF CARBON DIOXIDE, OXYGEN - PERCENT
    SATURATION, Partial pressure (or fugacity) of carbon dioxide - atmosphere, Partial
    pressure (or fugacity) of carbon dioxide - water, SALINITY and SEA SURFACE TEMPERATURE.
    The instruments used to collect these data include Bubble type equilibrator for
    autonomous carbon dioxide (CO2) measurement and Carbon dioxide (CO2) gas analyzer.nnThese
    data were collected by Nicholas Bates of Bermuda Biological Station for Research
    and Adrienne Sutton, Christopher Sabine and Stacy Maenner of US DOC; NOAA; OAR;
